With TiKV version >= 6.1.0, we release a new feature called "TiKV API V2" which provides a new raw key-value storage format allowing the coexistence of RawKV and TxnKV. Please refer to v6.10 release notes for detail. To enable the API V2 mode, users need to specify the API version of the client. // import ...
import org.tikv.common.TiConfiguration.ApiVersion; public class Main { public static void main() { TiConfiguration conf = TiConfiguration.createRawDefault("127.0.0.1:2379"); conf.setApiVersion(ApiVersion.V2); try(TiSession session = TiSession.create(conf)) { try(RawKVClient client = session.createRawClient()) { // The client will read and write date in the format of API V2, which is // transparent to the users. client.put(ByteString.copyFromUtf8("hello"), ByteString.copyFromUtf8("world")); // other client operations. } } }
}

