To interact with TiKV, we should first create a TiConfiguration with PD address, create a TiSession using TiSession.create, and then create a client. For example, if we want to put a World in Hello key in RawKV, write the following code in src/main/java/com/example/App.java. import org.tikv.common.TiConfiguration;
import org.tikv.common.TiSession;
import org.tikv.raw.RawKVClient;
import org.tikv.shade.com.google.protobuf.ByteString; public class App { public static void main(String[] args) throws Exception { String pdAddr = "127.0.0.1:2379"; // You MUST create a raw configuration if you are using RawKVClient. TiConfiguration conf = TiConfiguration.createRawDefault(pdAddr); try (TiSession session = TiSession.create(conf)) { try (RawKVClient client = session.createRawClient()) { client.put(ByteString.copyFromUtf8("Hello"), ByteString.copyFromUtf8("World")); ByteString value = client.get(ByteString.copyFromUtf8("Hello")); System.out.println(value); } } }
} More examples for RawKV and TxnKV are in following chapters.
